<html>
  <head>
    <meta http-equiv="Content-type" content="text/html;charset=UTF-8">
    <title>Offline</title>
    <style type="text/css">
      body {
        text-align: center;
        padding: 10vmin;
        background-color: #00bdbd;
        overflow: hidden;
      }
      h1 {
        font-size: 10vmin;
        padding: 3vmin;
      }
      body {
        font: 20px 'Open Sans', Helvetica, Arial, sans-serif;
        color: #fff;
      }
      .icon {
        padding: 3vmin;
      }
      #content {
        text-align: center;
        position: absolute;
        left: 50%;
        -webkit-transform: translateX(-50%);
        -moz-transform: translateX(-50%);
        -o-transform: translateX(-50%);
        -ms-transform: translateX(-50%);
        transform: translateX(-50%);
        width: 80%;
      }
      #content p {
        font-size: 5vmin;
        color: #fff;
      }
      .action {
        height: 100px;
        margin-top: 20px;
        margin-bottom: 10px;
      }
      .button {
        background-color: #474d5d;
        position: relative;
        width: 40vmin;
        padding: 15px 40px;
        border-top: 0px;
        border-left: 0px;
        border-right: 0px;
        font-size: 5vmin;
        vertical-align: middle;
        -webkit-border-radius: 1px;
        -moz-border-radius: 1px;
        border-radius: 1px;
        transition: all 0.1s;
        left: 50%;
        -webkit-transform: translateX(-50%);
        -moz-transform: translateX(-50%);
        -o-transform: translateX(-50%);
        -ms-transform: translateX(-50%);
        transform: translateX(-50%);
        transform: translateX(-50%);
      }
      .button a {
        color: #fff;
        text-decoration: none;
      }
      .button a:hover {
        text-decoration: none;
      }
      .button:hover {
        background-color: #373d4c;
      }
      .button:active {
        top: 2px;
        -webkit-box-shadow: none;
        box-shadow: none;
      }
      .button:focus {
        outline: 0;
      }
    </style>
